import axios from 'axios'

const apiClient = axios.create({
    baseURL: 'http://127.0.0.1:30000'
})

export default {
    async entryData(entry_id, player_cookie) {
        try {
            return await apiClient.get(`/entry_data/${entry_id}?player_id=${player_cookie}`);
        }
        catch (error) {
            throw error;
        }
    }
}
